	//      the line breaking class of the base character in all of the
	//      following rules. Treat ZWJ as if it were CM.
	//   Treat X (CM | ZWJ)* as if it were X.
	//   where X is any line break class except BK, CR, LF, NL, SP, or ZW.
	//
