	//   CP  PO
	//   CL  PR
	//   CP  PR
	//   NU  PO
	//   NU  PR
	//   PO  OP
	//   PO  NU
	//   PR  OP
	//   PR  NU
	//   HY  NU
	//   IS  NU
	//   NU  NU
	//   SY  NU
