	function fetchPlainClusters (line) {
		const result = [];
		const clusters = getLineBreakableClusters(line);
		for (const cluster of clusters) {
			result.push([cluster.text, getColumnsFor.plain(cluster.text, options.awidth)]);
		}
		return result;
	}

